style.css:
@-moz-document domain("roblox.com") {
/* Cambiar el fondo de la página */
    body {
        background-image: url('https://i.pinimg.com/564x/c0/ad/f4/c0adf4d32e0314e7a8aff3302272e109.jpg'); /* URL de la imagen de fondo */
        background-size: cover; /* Ajustar el tamaño del fondo */
        color: #333; /* Color del texto principal */
    }

    /* Cambiar la barra de navegación */
    .rbx-navbar {
        background-color: #ff9db8; /* Color de fondo de la barra de navegación */
        color: #ffffff; /* Color del texto de la barra de navegación */
    }

    /* Estilos para la sección de perfil */
    .profile-header-content, .profile-avatar-mask, .profile-statistics .section-content {
        background-color: #ffffff; /* Color de fondo de la sección de perfil */
        color: #333; /* Color del texto en la sección de perfil */
    }

    /* Estilos para el contenedor de juegos */
    .game-container {
        background-color: #f8d5db; /* Color de fondo del contenedor de juegos */
        color: #333; /* Color del texto en el contenedor de juegos */
    }

    /* Estilos para el panel de chat */
    .chat-body {
        background-color: #ffffff; /* Color de fondo del panel de chat */
        color: #333; /* Color del texto en el panel de chat */
    }

    /* Estilos para la sección del catálogo */
    .catalog-container {
        background-color: #ffffff; /* Color de fondo de la sección del catálogo */
        color: #333; /* Color del texto en la sección del catálogo */
    }

    /* Estilos para la sección de footer */
    .container-footer {
        background-color: #ffffff; /* Color de fondo del footer */
        color: #333; /* Color del texto en el footer */
    }
}
